INSERT INTO `articolo` (`id`, `pubblicato`, `data_pubblicazione`, `titolo`, `summary`, `testo`, `id_redattore`, `id_immagine`) VALUES
(2, 1, '2024-05-26', 'NVIDIA multata di $ 5,5 milioni', 'Nvidia multata per non aver rivelato le sue entrate dal mondo delle cryptovalute', 'La SEC (US Securities and Exchange Commission) ha confermato oggi che Nvidia e’ stata multata per non aver fornito infomazioni sufficienti ai suoi azionisti. Per questo motivo la societa’ paghera’ una multa di 5.5 milioni di dollari per non aver rivelato l’impatto delle criptovalute sulla vendita delle schede grafiche. Durante i trimestri consecutivi dell’anno fiscale 2018, Nvidia non informo’ i suoi azionisti su quante schede video avesse venduto al mercato delle criptovalute. A causa della volatilità di questo mercato, ciò potrebbe aver portato gli investitori nell’incertezza e, di conseguenza, a compiere cattivi investimenti.\n\n“NVIDIA’s disclosure failures deprived investors of critical information to evaluate the company’s business in a key market,” says SEC Crypto Assets and Cyber Unit head Kristina Littman. “All issuers, including those that pursue opportunities involving emerging technology, must ensure that their disclosures are timely, complete, and accurate.”\nLa questione principale sta nel fatto che il mercato delle cryptovalute e’ decisamente instabile. Quindi i numeri reali sulle vendite da parte di Nvidia non avrebbero indicato necessariamente una crescita futura affidabile, rendendo l’investimento in essa più rischioso. Nascondendo questi numeri sulle vendite, la societa’ ha manipolato il giudizio degli investitori facendo pensare ad una crescita affidabile delle vendite, attirando investitmenti basati su una falsa solidita’ delle vendite. Sull’argomento Nvidia non ha rilasciato nessuna dichiarazione, ma ha deciso di pagare la multa.', 'moderator', 2),
(3, 1, '2024-05-26', 'G.SKILL Trident Z5 DDR5-6400 CL32 RAM Kit', 'G.SKILL rilascia il kit di memoria Trident Z5 DDR5-6400 CL32 a bassissima latenza', '(27 gennaio 2022) – G.SKILL International Enterprise Co., Ltd., il principale produttore mondiale di memoria per prestazioni estreme e periferiche di gioco, annuncia il lancio di una memoria DDR5-6400 CL32 da 32 GB a bassissima latenza e alta velocità. Il kit di memoria (2×16 GB) della serie di memorie della famiglia Trident Z5, progettato per i più recenti sistemi dotati di processori desktop Intel Core™ di 12a generazione e schede madri con chipset Intel Z690.\n\nLatenza estremamente bassa CL32 su DDR5-6400\nDedicato allo sviluppo di moduli di memoria sempre più veloci, G.SKILL sta lanciando un kit di memoria DDR5-6400 CL32-39-39-102 a latenza ultra bassa a 1,40V con capacità del kit di 32 GB (2×16 GB). Dotata di tempi eccezionalmente ridotti, questa specifica di memoria estrema rappresenta il passo successivo delle prestazioni di punta della famiglia Trident Z5. Lo screenshot che trovate qui sotto mostra questo kit di memoria testato sul processore Intel® Core™ i7-12700K e sulla scheda madre ASUS ROG Maximus Z690 Hero.\n\nDisponibilità\nI kit di memoria DDR5-6400 CL32 da 32 GB (2×16 GB) sono ora disponibili tramite i partner di distribuzione mondiale di G.SKILL.', 'moderator', 3),
(4, 1, '2024-05-26', 'DDR4 vs DDR5 cosa cambia?', 'Quali sono le sostaziali differenze fra le due memorie e quale conviene comprare?', 'COSA ABBIAMO IN PIU’?\n\nCon il lancio dei processori Intel Alder Lake-S assisteremo all’introduzione dello standard DDR5 per le memorie RAM.\n\nMa cosa offrira’ in piu’ questo standard rispetto al vecchio DDR4?\n\nQuesto nuovo standard nasce con un obiettivo preciso: offrire all’utente un raddoppio della densita’ e della bandwidth rispetto alle DDR4 e allo stesso tempo una maggiore efficienza.\n\nIl perche’ di queste nuove RAM e’ semplice, sono nate per assecondare la richiesta sempre piu’ alta di bandwidth dei processori in commercio e futuri.\n\nInfatti con l’aumento dei core delle CPU assistiamo ad una maggiore richiesta di banda da parte dei processori.\n\n\n\nGo to top\nUna delle novita’ piu’ interessanti riguarda appunto la densita’ dei chip presenti sui banchi di memoria RAM. Passa dai 16Gbit a 64Gbit. Grazie al Die Stacking (Chip Stacking, Vertical Integration) ovvero la tecnologia che permette ad ogni singolo chip sul banco di memoria di avere 8 strati sovrapposti, potenzialmente potranno essere raggiunti i 2TB di capacita’ per singolo modulo.\n\n\n\nPIU’ EFFICIENTI!\n\nAltro cambiamento rispetto allo standard attuale DDR4 sara’ la gestione dell’energia. Poiche’ i chip che si occupano appunto di questo verranno spostati dalla scheda madre direttamente sul modulo RAM. Questo permettera’ di gestire in modo piu’ preciso la tensione e di garantire una minore rumorosita’ ed una maggiore integrita’ del segnale.\n\nIn termini di architettura il cambiamento nelle DDR5 consiste nel fatto che ogni DIMM ha due canali con un’ampiezza di 40 bit per ognuno di essi (32 bit per i dati e 8 bit di ECC) rispetto alle DDR4 che hanno un canale a 72 bit (64 bit per i dati e 8 bit ECC).\n\nQuesta differenza si traduce in una maggiore efficienza nell’accesso alla memoria.\n\nInoltre cambia non solo l’architettura del canale DIMM ma anche quella del modulo stesso. Sia il lato destro che sinistro del modulo hanno ora un canale indipendente a 40bit ciascuno con un RCD condiviso. Grazie a queste modifiche viene risolto il problema che si origina con la diminuzione della tensione di alimentazione ovvero un margine di rumore piu’ basso.\n\n\n\nNei moduli DDR5 inoltre il Burst Lenght, vale a dire la quantita’ di dati trasferiti tra la CPU e la RAM in ogni trasmissione. Passa da 8 a 16 e quindi permette di avere accesso a 64 byte di dati che in questo caso e’ la stessa quantita’ della cache delle attuali CPU.\n\nDIFFERENZE FISICHE\n\nFisicamente la differenza tra i moduli DDR4 e DDR5 nonostante mantengano entrambi i 288 pin e’ legata alla posizione del notch che quindi non permettera’ l’inserimento delle memorie DDR4 negli slot DDR5 e viceversa.\n\nInsomma queste nuove RAM promettono di offrire una maggiore banda e capienza ed una migliore gestione energetica.\n\nL’unico “svantaggio” al lancio, ovviamente oltre al prezzo, sara’ la latenza CL dei nuovi moduli. Troviamo, infatti in nuovi moduli con una latenza CL=40 che potrebbe portare inizialmente i moduli DDR4 di fascia alta a poter competere con i moduli DDR5 entry level. Ovviamente ci aspettiamo che la latenza come avvenuto per le precedenti generazioni migliorera’ nel tempo piu’ la tecnologia diventera’ matura.', 'moderator', 4),
(5, 0, NULL, 'Rumor: AMD aggiorna le Radeon RX 6000', 'Si dice che AMD lancerà l’aggiornamento della Radeon RX 6000 “RDNA 2” a metà del 2022, anche RX 6500 non-XT è in lavorazione', 'Questo nuovo rumor arriva con un tweet da Greymon55 nel quale rivela che AMD starebbe lanciando la sua serie Radeon RX 6X50XT nel giugno-luglio del 2022. Molte sono le voci di un aggiornamento di RDNA 2 in preparazione per la metà del 2022 e sembra potremmo vedere l’annuncio al Computex 2022 e un lancio subito dopo. Le nuove gpu avranno lo schema di numerazione 6*50 e saranno disponibili solo nelle versioni “XT”. Le GPU AMD che verranno aggiornate sono le Navi 21 e Navi 22. La GPU AMD Navi 21 attualmente alimenta le Radeon RX 6900 XT, RX 6800 XT e RX 6800 mentre la GPU Navi 22 alimenta la RX 6700 XT sulla piattaforma desktop.\n\nI precedenti rumor riguardavano il fatto che le nuove Radeon RX 6000 saranno dotate di memoria GDDR6 da 18 Gbps. Attualmente solo la 6900 XT LC e la 6500 XT sono dotate di memoria da 18Gbps, tutte le altre schede AMD hanno memorie da 16Gbps. Questo incremento offrira’ una larghezza di banda maggiore e quindi un’incremento delle prestazioni. Anche se  bisogna ammettere che non sara’ nulla di eccezionale questo incremento di prestazioni rispetto alle schede video AMD gia’ in produzione.\nQuesta scheda video a cui sta lavorando AMD sarà basata sul core della GPU Navi 24 a 6 nm. L’RX 6500 dovrebbe avere un prezzo di circa $130 US, il che la renderà almeno $70 US in meno rispetto all’RX 6500 XT, ma dovremo vedere se i clock sono configurati in modo simile all’RX 6400 poiché c’è una differenza di 500 MHz tra il 6500 XT e il 6400 e ciò è dovuto principalmente all’assenza di un connettore di alimentazione esterno (53 W TGP). La scheda conterrebbe 768 core e una memoria GDDR6 da 4 GB su un’interfaccia bus a 64 bit più 16 MB di Infinity Cache.', 'moderator', 5);

